reg_aerienne:
Attention, nous sommes sous les TMA 1 & 2 Chambéry ;
Donc altitude maxi 1000m sur la période du 15 déc. au 07 avril, du vendredi matin au lundi 11h00 UTC  (TMA Classée en D) ;
Puis  FL115 (~3500m) pour la période du 08 avril au 14 déc, et du 15 déc. au 07 avril (lundi 11h00 UTC au jeudi soir), (TMA Classée en E)

acces:
Pas d'autorisation (tolérance très précaire)
Stationner sur la place en face de la mairie ;
Champ derrière le stade de foot, le tennis et le stade de boules

